---
:sq:
  :ordinals:
    :rule: 'lambda { |num, runtime| n = runtime.n(num); i = runtime.i(num); v = runtime.v(num);
      w = runtime.w(num); f = runtime.f(num); t = runtime.t(num); ((n % 10 == 3 &&
      n % 100 != 13) ? :few : ((n % 10 == 4 && n % 100 != 14) ? :many : (n == 1 ?
      :one : ((n % 10 == 2 && n % 100 != 12) ? :two : :other)))) }'
    :names:
    - :few
    - :many
    - :one
    - :two
    - :other
  :plurals:
    :rule: 'lambda { |num, runtime| n = runtime.n(num); i = runtime.i(num); v = runtime.v(num);
      w = runtime.w(num); f = runtime.f(num); t = runtime.t(num); (n == 1 ? :one :
      :other) }'
    :names:
    - :one
    - :other
